import axios from 'axios';

const baseUrl =
  'https://instagram-scrapper-posts-reels-stories-downloader.p.rapidapi.com/posts_by_user_id';
const API_KEY = 'f9e57f828amshd963e76fe4aa193p1f24e6jsn390afa4788fe';

const FetchUserInstagramPosts = async id => {
  const options = {
    method: 'GET',
    url: baseUrl,
    params: {
      user_id: '25025320',
    },
    headers: {
      'x-rapidapi-key': API_KEY,
      'x-rapidapi-host':
        'instagram-scrapper-posts-reels-stories-downloader.p.rapidapi.com',
    },
  };

  try {
    const response = await axios.request(options);
    console.log(response.data);
  } catch (error) {
    console.error(error);
  }
};

export default FetchUserInstagramPosts;
